.el-carousel {
  height: 60px;
}
.el-carousel .el-carousel__container {
  height: 100%;
}
.el-carousel__arrow {
  top: 40%!important
}
.el-carousel__item {
  padding: 0px 30px 0 45px;
  box-sizing: 'border-box'
}
.el-carousel__item div {
  float: left;
  margin: 0 15px;
  width: 65px;
  height: 40px;
  cursor: pointer;
}
.el-carousel__item div img {
  width: 30px;
  height: 30px;
  margin: 0 0 0 15px;
}
.el-carousel__item div p {
  position: relative;
  top: -8px;
  margin: 0;
  text-align: center;
  color: #888585;
  font-size: 12px;
}
